histreg._queryString:
{[reg;sdate;edate]
  h2: hopen `:localhost:HDBPORT:admin:admin;
  hist:h2"select from flights where date within(", (string sdate),";",(string edate),")";
  typehist:distinct select date, sym, depAirport, depTime, arivTime, arivAirport, flightNumber, aircraftType, registration from hist where registration like reg

 / mostused:exec aircraftType from typehist where typecount=max typecount;
  /mostusedCount:exec typecount from typehist where typecount=max typecount;

  /([] numAircraftsToday: enlist numAircrafts; mostPopCraft: enlist mostused; MostPopAmount: enlist mostusedCount)
 }

testhist._queryString:
{[reg;sdate;edate]
  h5: hopen `:localhost:HDBPORT:admin:admin;
  hist:h5"select from flights where date within (",(string sdate),";",(string edate),")";
  hclose h5;

 co:count (distinct select sym, depAirport, depTime, arivTime, arivAirport, flightNumber, aircraftType, registration from hist where registration like reg);
 avgco:co%1+edate-sdate;
  y:exec distinct aircraftType from hist where registration like reg;
 ([]numberOfFlights:enlist co; regi:enlist reg;avgcount:enlist "i"$avgco)
 }

