aircraftDetailsSingle._queryString:
{[start;end;craft]

  h2: hopen `:localhost:HDBPORT:admin:admin;
  todayCraft:distinct select sym,depAirport,depTime,arivTime,arivAirport,flightNumber,aircraftType,registration from flights where aircraftType=craft;
  histcraft:h2"distinct select date, sym,depAirport,depTime,arivTime,arivAirport,flightNumber,aircraftType,registration from flights where date within(", (string start),";",(string end),"), aircraftType=`", (string craft);
  
  /craftInfoAllTime:h(`.gw.syncexec; "distinct select sym,depAirport,depTime,arivTime,arivAirport,flightNumber,aircraftType,registration from flights where aircraftType=`",string craft;`hdb`rdb);
 histschedulednumflights:count histcraft;
 toschedulednumflights:count todayCraft;
 hstavgscheduled: histschedulednumflights%1+end-start;
 hmax:exec max eachdaycount from select eachdaycount:count i by date from histcraft;

 flip ([] Today:enlist toschedulednumflights; Historic:enlist histschedulednumflights; dailyAverage:enlist "i"$hstavgscheduled; dailyMaximum:enlist hmax)
    
  }

