histcraftsummary._queryString:
{[st;ed] 
  h2: hopen `:localhost:HDBPORT:admin:admin;
  historicalcraft:h2"select from flights";
  historicalcraft: select from historicalcraft where date within (st;ed);
  
  typehist:select historicalTotal:count i, historicalAverage:((count i)%1+ed-st) by aircraftType from distinct select sym,depAirport,depTime,arivTime,arivAirport,flightNumber,aircraftType from historicalcraft;
 
  hnumAircrafts:count typehist;
  hTotalMax:exec historicalTotal from typehist where historicalTotal=max historicalTotal;
  hmostused:exec aircraftType from typehist where historicalAverage=max historicalAverage;
  hmostusedCount:exec historicalAverage from typehist where historicalAverage=max historicalAverage;

  ([] hNumberOfAircrafts: enlist hnumAircrafts; mostPopularCraft: enlist hmostused; MostPopAvgAmount: enlist .Q.fmt[6;2;hmostusedCount[0]]; mostPopTotCount:enlist hTotalMax)
  
 }

